import React from 'react';
import './buttontext.css';

const Buttontext = ({ onClick = () => {}, label = "Buttontext" }) => {
  return (
    <div className="textbutton-wrapper">
      <span className="textbutton" onClick={onClick}>
        {label}
      </span>
    </div>
  );
};

export default Buttontext;
